  (1,'S','Un''azienda con piu'' di 35 dipendenti ha la facolta'' di essere esonerata dall''obbligo di assumere una quota di disabili mediante una richiesta inoltrata alla Regione, in cui l’azienda ha la sede legale, previo versamento di un ''''contributo esonerativo''''.  Le imprese possono inserire una dichiarazione ai fini del versamento se hanno presentato il prospetto informativo e la richiesta di esonero per l''anno di riferimento della dichiarazione.','100001','Dichiarazioni di versamento degli esoneri parziali','S'),
